import React, { Component } from 'react';
import { AppBar, Toolbar, Button } from '@material-ui/core'

class Dashboard extends Component {

	render () {
		return (
			<AppBar position="static">
			  <Toolbar>
			  <Button> Test </Button>
			  </Toolbar>
			</AppBar>
			)
	}
}

export default Dashboard
